import '../../styles/Footer.css';
import React from 'react';
import { NavLink } from 'react-router-dom';

const Footer = () => {
    return(
        <footer className="footer">
            <div className = "footer_logo">
                <a href = "/">BECOMING<br/>BUSINESSWOMEN</a>
            </div>
            <div className = "footer_navigation-items">
                <ul>
                    <li><NavLink activeClassName="active" to="/" exact>Privacy</NavLink></li>
                    <li><NavLink activeClassName="active" to="/about">F.A.Q.</NavLink></li>
                    <li><NavLink activeClassName="active" to="/our-team">Terms & Conditions</NavLink></li>
                    <li><NavLink activeClassName="active" to="/join">Contact Us</NavLink></li>
                </ul>
            </div>
        </footer>
    )
}

export default Footer;
